	/* checks if  today's date is same as the date passed in function*/
	function dayCheck(d, today_day) {
		var all_good = true // if all_good stays true, then the current day and d are not equal
		if (d.includes("M") && today_day == 1){
			all_good = false
		}
		if (d.includes("Tu") && today_day == 2){
			all_good = false
		}
		if (d.includes("W") && today_day == 3){
			all_good = false
		}
		if (d.includes("Th") && today_day == 4){
			all_good = false
		}
		if (d.includes("F") && today_day == 5){
			all_good = false
		}
		
		return all_good
	}

	function timeCheck(start, end, current_hour, current_min) {
		var all_good = true
		
		// parsing the class start times into variables
		var start_split = start.split(":")
		var st_hour = start_split[0]
		st_hour = parseInt(st_hour, 10)
		var st_min = start_split[1]
		var am_or_pm = st_min.slice(-2)
		st_min = st_min.slice(0,2)
		st_min = parseInt(st_min, 10)
		
		if (am_or_pm == "pm") { // if start time is pm
			if (st_hour < 12) { // if class time before 12pm
				st_hour = st_hour + 12 // add 12 to convert from 12-hour format to 24-hour format
			}
		} else {
			if (st_hour == 12) {
				st_hour = 0 // if 12am, then 24 format would be 0
			}
		}
		
		// parsing the class end times into variables the same way
		var end_split = end.split(":")
		var end_hour = end_split[0]
		end_hour = parseInt(end_hour, 10)
		var end_min = end_split[1]
		var am_or_pm = end_min.slice(-2)
		end_min = end_min.slice(0,2)
		end_min = parseInt(end_min, 10)
			
		if (am_or_pm == "pm") {
			if (end_hour < 12) {
				end_hour = end_hour + 12
			}
		} else {
			if (end_hour == 12) {
				end_hour = 0
			}
		}
  
		console.log(st_hour.toString() + ":" + st_min.toString() + " " + end_hour.toString() + ":" + end_min.toString())
				
		if (current_hour >= st_hour) { // if current hour is equal or after start time
    		if (current_hour < end_hour) { // if start_hour >= current hour < end_hour
      			all_good = false // then room is occupied
    		} else { // if start_hour >= current hour >= end_hour
      			if (current_hour == end_hour && current_min <= end_min) {
        			all_good = false // class still in session, room is occupied
      			}
    		}
 	 	}
	
		return all_good
	}

	function onlyUnique(value, index, self) { 
		return self.indexOf(value) === index;
	}
